import React from 'react'

const Products = (props) => {
    const items = props.product.products
    
  return (
    <>
    <ol>
      {items.map((item)=>(
         <li>{item.title}
         <img src={item.thumbnail} alt='this is picture' height='100px' width='100px'/>
         <p>{item.description}</p>
         <h3>${item.price}</h3>
         </li>
      ))}
        </ol>  
    </>
  )
}

export default Products
